English | CBR | 2 Issues

Birds of Prey #21-22
Publisher:  DC Comics
Publication Date:  June 19, 2013 and July 17, 2013

Writer:  Christy Marx
Penciller:  Romano Molenaar (#21-22) and Robson Rocha (#22)
Breakdowns:  Scott McDaniel
Inker:  Jonathan Glapion (#21-22) and Sandu Florea (#22)
Colorist:  Chris Sotomayor
Letterer:  Dezi Sienty
#21 Cover Artists:  Romano Molenaar and Vicente Cifuentes with Chris Sotomayor
#22 Cover Artists:  Scott McDaniel, Romano Molenaar, Jonathan Glapion, and Chris Sotomayor

Birds of Prey #21
The Birds are forced to work with Calvin Rose in order to protect one of their own. Continued in TALON #9!

Birds of Prey #22
Betrayed by one of their own and homeless, the last thing the Birds need is another shock--which makes it a bad time to uncover Condor's link to Basilisk.

Thanks goes to G85 for this release.

